// the function was used to initialize the array storing item information
// the function was invoked when the page is reset or reloaded
function initializeArray(ROWS, COLS, defaultValue){
  var arr = [];
  // Creates all lines:
  for(var i=0; i < ROWS; i++){
      // Creates an empty line
      arr.push([]);
      // Adds cols to the empty line:
      arr[i].push( new Array(COLS));
      for(var j=0; j < COLS; j++){
        // Initializes:
        arr[i][j] = defaultValue;
      }
  }
  return arr;
}

