function computeResult(){
	// prepare input array
	checkInfo();
	console.log("\n");
	// empty grid
	var grid = [];
	for(var i=0; i < ROWS; i++){
		grid.push([]);
		grid[i].push( new Array(COLS));
		for(var j=0; j < COLS; j++){
			grid[i][j] = " ";
		}
  	}
  	// we assign element to this empty array
  	// "?"correspond to question.jpg	0
  	// "*"correspond to star.jpg		1
  	// "."correspong to circle.jpg		2
  	// "S"correspond to square.jpg		3
	// "T"correspond to triangle.jpg	4
	// "C"correspond to cross.jpg		5
  	for(var i=0;i<ROWS;++i){
		for(var j=0;j<COLS;++j){
			if(itemInfo[i][j]=="?"){
				grid[i][j]=0;
			}
			else if(itemInfo[i][j]=="*"){
				grid[i][j]=1;
			}
			else if(itemInfo[i][j]=="."){
				grid[i][j]=2;
			}
			else if(itemInfo[i][j]=="S"){
				grid[i][j]=3;
			}
			else if(itemInfo[i][j]=="T"){
				grid[i][j]=4;
			}
			else if(itemInfo[i][j]=="C"){
				grid[i][j]=5;
			}
			else{
				console.log("could not map image to input grid for computation");
			}
		}
		checkGrid(grid);
		console.log("\n");
	}
	// we have grid now, we can start to compute grid
	solve_sudoku(grid);
	checkGrid(grid);
	// we convert grid to itemInfo for draw
	for(var i=0;i<ROWS;++i){
		for(var j=0;j<COLS;++j){
			if(grid[i][j]==0){
				itemInfo[i][j]="?"
			}
			else if(grid[i][j]==1){
				itemInfo[i][j]="*";
			}
			else if(grid[i][j]==2){
				itemInfo[i][j]=".";
			}
			else if(grid[i][j]==3){
				itemInfo[i][j]="S";
			}
			else if(grid[i][j]==4){
				itemInfo[i][j]="T";
			}
			else if(grid[i][j]==5){
				itemInfo[i][j]="C";
			}
			else{
				console.log("could not map grid to Image for draw");
			}
		}
	}
	checkInfo();
	drawArray();
}

