// 找出目前没有被赋值的位置，若全部都被填满，则返回False
function find_empty_location(arr, l){
    for(var i =0;i<ROWS;++i){
        for(var j =0;j<COLS;++j){
	        if (arr[i][j] == 0){
            	l[0] = i;
                l[1] = j;
                return true;
            }
        }
    }
    return false;
}
// 找出num在该arr的row行是否出现过
function used_in_row(arr, row, num){
    for(var i=0;i<ROWS;++i){
        if (arr[row][i] == num){
            return true;
        }
    }
    return false;
}

// 找出num在该arr的col列是否出现过
function used_in_col(arr, col, num){
    for(var i=0;i<COLS;++i){
        if (arr[i][col] == num){
	        return true;
        }   
    }
    return false;
}

function check_location_is_safe(arr, row, col, num){
    return (!used_in_row(arr, row, num)) && (!used_in_col(arr, col, num));
}

function solve_sudoku(arr){
    // 当前搜索的第几行、第几列
    var l = [0, 0];
    // 找出还未被填充的位置
    if (!find_empty_location(arr, l)){
	    return true;
    }
    // 未被填充的位置，赋值给row，col
    var row = l[0];
    var col = l[1];
    for (var num=1;num<6;++num){
        if (check_location_is_safe(arr, row, col, num)){
            arr[row][col] = num;
            if (solve_sudoku(arr)){
	            return true;
            }
            // 若当前num导致未来并没有结果，则当前所填充的数无效，置0后选下一个数测试
            arr[row][col] = 0;
		}
	}
    return false;
}



